const camelCase=require("camelcase");function parseStyleElementName(e){return camelCase(e)}function generateDomModule(e){return`const ${e} =  document.createElement('dom-module')`}function wrapWithTags(e,n){return`${e}.innerHTML = \`        <template>            <style>                ${n}            </style>        </template>\`    `}function registerElement(e,n){return`        ${e}.register('${n}');     `}module.exports=function(e,n){const t=parseStyleElementName(e);return`        ${generateDomModule(t)}        ${wrapWithTags(t,n)}        ${registerElement(t,e)}    `};